To determine the number of sides of a polygon given the sum of its interior angles, we use the formula for the sum of the interior angles of a polygon with \( n \) sides:

\[
\text{Sum of interior angles} = 180(n-2)
\]

We are given that the sum of the interior angles is \( 1070^\circ \). Therefore, we set up the equation:

